import PokemonesProvider from  "./context/PokemonesContext"
import PokemonProvider from  "./context/PokemonContext"
root.render(
  <StrictMode>
    <PokemonesProvider>
    <PokemonProvider>
    <App />
    </PokemonProvider>
    </PokemonesProvider>
  </StrictMode>
);
